import { Pipe, PipeTransform } from '@angular/core';
import { MappedServable, Servable } from '@app/core/data/types';

@Pipe({
  name: 'mappedServable',
})
export class MappedServablePipe implements PipeTransform {
  transform(servable: Servable): MappedServable {
    const mappedServable = {
      fullName: servable.fullName,
      name: servable.name,
      status: servable.status,
      message: servable.message,
    };
    if (servable.status === 'Serving' && servable.message) {
      mappedServable.status = 'Warning';
    }
    if (!servable.status) {
      mappedServable.status = 'Undefined';
    }

    return mappedServable;
  }
}

import { Pipe, PipeTransform } from '@angular/core';
import matchSorter from 'match-sorter';

@Pipe({
  name: 'matchSorter',
})
export class MatchSorterPipe implements PipeTransform {
  transform(input: any[] = [], options: object | string, value: string): any {
    return matchSorter(
      input,
      value,
      typeof options === 'string' ? { keys: [options] } : options
    );
  }
}

import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
  name: 'pluck',
})
export class PluckPipe implements PipeTransform {
  transform<T, K extends keyof T>(value: T, key: K): T[K] {
    return value[key];
  }
}

import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
  name: 'sortBy',
})
export class SortByPipe implements PipeTransform {
  transform(items: any[], property: string): any {
    if (!items || !property) {
      return items;
    }
    return items.sort((leftItem: any, rightItem: any): number => {
      if (leftItem[property] > rightItem[property]) {
        return 1;
      }
      if (leftItem[property] < rightItem[property]) {
        return -1;
      }
      return 0;
    });
  }
}

import { PipeTransform, Pipe } from '@angular/core';
import { formatDistance } from 'date-fns';

@Pipe({
  name: 'hsTimeAgo',
})
export class TimeAgoPipe implements PipeTransform {
  transform(time: number | Date | string): string {
    return formatDistance(new Date(time), new Date());
  }
}

