  EventEmitter,
} from '@angular/core';
import { ChartConfig } from '../../../models';
import { MonitoringPageService } from '../../../containers/monitoring-page/monitoring-page.service';
import {
  format,
  ticks,
  extent,
  mouse,
  scaleLinear,
  ScaleLinear,
  select,
  axisLeft,
  axisBottom,
} from 'd3';
import { BehaviorSubject } from 'rxjs';

interface Tooltip {
