import { Injectable } from '@angular/core';
import { BehaviorSubject } from 'rxjs';

@Injectable({ providedIn: 'root' })
export class AggregationPaginator {
  elementsPerColumn$: BehaviorSubject<number> = new BehaviorSubject(10);

  canLoadNewer(offset: number): boolean {
    return offset !== 0;
  }

  canLoadOlder(
    totalBatchesCount: number,
    showedBatchesCount: number,
    offset: number
  ): boolean {
    return showedBatchesCount + offset < totalBatchesCount;
  }
}

import { combineLatest, Observable, Subject } from 'rxjs';
import {
  map,
  tap,
  shareReplay,
  takeUntil,
  withLatestFrom,
} from 'rxjs/operators';

import { Injectable, OnDestroy } from '@angular/core';
import { neitherNullNorUndefined } from '@app/utils';

import { Aggregation, AggregationsList } from '../../models';
import { AggregationPaginator } from '../../services/aggregation-paginator';
import { MonitoringFacade } from '../../store/monitoring.facade';

@Injectable({
  providedIn: 'root',
})
export class AggregationService implements OnDestroy {
  private readonly aggregationList$: Observable<AggregationsList>;
  private destroy$: Subject<any> = new Subject<any>();

  constructor(
    private monitoringStore: MonitoringFacade,
    private paginator: AggregationPaginator,
  ) {
    this.aggregationList$ = this.monitoringStore
      .getAggregationList()
      .pipe(shareReplay(1));

    this.checkSelectedAggregation();
  }

  ngOnDestroy() {
    this.destroy$.next();
    this.destroy$.complete();
  }

  getSelectedAggregation(): Observable<Aggregation> {
    return this.monitoringStore.getSelectedAggregation();
  }

  getAggregationList(): Observable<AggregationsList> {
    return this.aggregationList$;
  }

  canLoadNewer(): Observable<boolean> {
    return this.monitoringStore
      .getOffset()
      .pipe(map(offset => this.paginator.canLoadNewer(offset)));
  }

  canLoadOlder(): Observable<boolean> {
    return combineLatest([
      this.getAggregationList(),
      this.monitoringStore.getOffset(),
    ]).pipe(
      map(([aggregations, offset]) => {
        if (aggregations) {
          return this.paginator.canLoadOlder(
            aggregations.totalBatchesCount,
            aggregations.showedBatchesCount,
            offset,
          );
        } else {
          return false;
        }
      }),
    );
  }

  loadOlder(): void {
    this.monitoringStore.loadOlderAggregation();
  }

  loadNewer(): void {
    this.monitoringStore.loadNewerAggregation();
  }

  private checkSelectedAggregation() {
    this.getAggregationList()
      .pipe(
        neitherNullNorUndefined,
        withLatestFrom(this.getSelectedAggregation()),
        tap(([aggregations, currentSelectedAggregation]) => {
          if (aggregations.totalBatchesCount === 0) {
            this.selectAggregation(undefined);
            return;
          }
          if (!aggregations.has(currentSelectedAggregation)) {
            this.selectAggregation(aggregations.lastAggregation);
            return;
          }
        }),
        takeUntil(this.destroy$),
      )
      .subscribe();
  }

  selectAggregation(agg: Aggregation): void {
    this.monitoringStore.selectAggregation(agg);
  }

  getMinDate(): Observable<Date> {
    return this.monitoringStore
      .getMinDate()
      .pipe(map(seconds => seconds && new Date(seconds * 1000)));
  }

  getMaxDate(): Observable<Date> {
    return this.monitoringStore
      .getMaxDate()
      .pipe(map(seconds => seconds && new Date(seconds * 1000)));
  }

  getFilterDateRange(): Observable<{ from: Date; to: Date }> {
    return this.monitoringStore.getFilterDateRange().pipe(
      map(range => {
        return (
          range && {
            from: new Date(range.from * 1000),
            to: new Date(range.to * 1000),
          }
        );
      }),
    );
  }

  changeDateTimeRange({ from, to }: { from: Date; to: Date }): void {
    this.monitoringStore.changeDateTimeRange({
      from: from.getTime(),
      to: to.getTime(),
    });
  }

  clearDateTimeFilter(): void {
    this.monitoringStore.clearFilterDateRange();
  }
}

import { Injectable } from '@angular/core';
import { Application, Signature } from '../types';

@Injectable({
  providedIn: 'root',
})
export class ApplicationBuilder {
  public build(props): Application {
    return this.toApplication(props);
  }

  private toApplication(props): Application {
    let id: number;
    let signature: Signature;

    if (props.id) {
      id = props.id;
    }

    if (props.signature) {
      signature = props.signature;
    }

    const application = new Application({
      id,
      signature,
      name: props.name,
      executionGraph: props.executionGraph || [],
      kafkaStreaming: props.kafkaStreaming || [],
      status: props.status && props.status.toLowerCase(),
      message: props.message,
      favorite: false,
    });

    return application;
  }
}

import { Injectable } from '@angular/core';
import {
  FormArray,
  FormBuilder,
  FormGroup,
  AbstractControl,
} from '@angular/forms';

import { CustomValidatorsService } from '@app/core/custom-validators.service';
import {
  Application,
  DeploymentConfig,
  ModelVersion,
} from '@app/core/data/types';
import {
  ModelVariantFormData,
  ModelVariantFormService,
} from '../model-variant-form/model-variant-form.service';

export interface StageFormData {
  modelVariants: ModelVariantFormData[];
}

interface ExecutionGraphFormData {
  stages: StageFormData[];
}

export interface FormData {
  name?: string;
  executionGraph: ExecutionGraphFormData;
}

@Injectable()
export class ApplicationFormService {
  private form: FormGroup;
  public modelVersions: ModelVersion[];
  public depConfig: DeploymentConfig;

  constructor(
    private fb: FormBuilder,
    private modelVariantFormService: ModelVariantFormService,
    private customValidators: CustomValidatorsService,
  ) {}

  public initForm(
    application: Application,
    modelVersions: ModelVersion[] = [],
    depConfig: DeploymentConfig,
  ): FormGroup {
    let data: FormData;

    this.modelVersions = modelVersions;
    this.depConfig = depConfig;

    if (application) {
      data = this.applicationToFormData(application, modelVersions);
    } else {
      data = this.defaultFormData();
    }
    this.form = this.fb.group({
      applicationName: this.fb.control(data.name, [
        this.customValidators.required(),
        this.customValidators.uniqNameValidation(data.name),
        this.customValidators.applicationNameformat(),
        this.customValidators.lengthValidation(128),
      ]),
      kafkaStreaming: this.fb.array([]),
      stages: this.fb.array(this.getStagesArray(data.executionGraph.stages)),
    });

    return this.form;
  }

  public applicationToFormData(
    application: Application,
    modelVersions: ModelVersion[],
  ): FormData {
    const stages = application.executionGraph.stages.map(stage => {
      const modelVariants: ModelVariantFormData[] = stage.modelVariants.map(
        mv =>
          this.modelVariantFormService.modelVariantToModelVariantFormData(
            mv,
            modelVersions,
          ),
        this.modelVariantFormService,
      );
      return { ...stage, modelVariants };
    });

    return {
      name: application.name,
      executionGraph: {
        stages,
      },
    };
  }

  public get stages(): FormArray {
    return this.form.get('stages') as FormArray;
  }

  public addStageControl(stage = this.defaultStageData()): void {
    this.stages.push(this.buildStageGroup(stage));
  }

  public addModelVariantToStage(stageControl: AbstractControl): void {
    const modelVariants = stageControl.get('modelVariants') as FormArray;
    modelVariants.push(
      this.modelVariantFormService.buildModelVariantFormGroup(
        this.defaultModelVariantData(),
      ),
    );
  }

  private buildStageGroup(stage): FormGroup {
    const modelVariants = stage.modelVariants.map(
      (modelVariant: ModelVariantFormData) => {
        return this.modelVariantFormService.buildModelVariantFormGroup(
          modelVariant,
        );
      },
    );

    return this.fb.group({
      modelVariants: this.fb.array(
        modelVariants,
        this.customValidators.weightValidation(),
      ),
    });
  }

  private getStagesArray(stages: any[] = []): FormGroup[] {
    return stages.map(stage => this.buildStageGroup(stage));
  }

  private defaultStageData(): StageFormData {
    return {
      modelVariants: [
        this.modelVariantFormService.defaultModelVariantFormData(
          this.modelVersions,
          this.depConfig,
        ),
      ],
    };
  }

  private defaultModelVariantData(): ModelVariantFormData {
    return this.modelVariantFormService.defaultModelVariantFormData(
      this.modelVersions,
      this.depConfig,
    );
  }

  private defaultFormData(): FormData {
    return {
      name: '',
      executionGraph: {
        stages: [this.defaultStageData()],
      },
    };
  }
}

