export const enum ChecksHealthFilterOptions {
  all = 'ALL',
  byScore = 'SCORE',
  withError = 'ERROR',
}

export interface ChecksFilter {
  filterBy: ChecksHealthFilterOptions;
  scoreFilter?: {
    byMetric: boolean;
    metricScoreRange: [number, number];
    byRaw: boolean;
    rawScoreRange: [number, number];
  };
}

const initialFilter: ChecksFilter = {
  filterBy: ChecksHealthFilterOptions.all,
  scoreFilter: {
    byMetric: true,
    metricScoreRange: [0, 100],
    byRaw: true,
    rawScoreRange: [0, 100],
  },
};

@Injectable({
  providedIn: 'root',
})
export class BatchDetailsService {
  private checks$: Observable<Check[]>;
  private filter: BehaviorSubject<ChecksFilter> = new BehaviorSubject<
    ChecksFilter
  >(initialFilter);
  private filter$: Observable<ChecksFilter>;

  constructor(
    private facade: MonitoringFacade,
    private modelVersionsFacade: ModelVersionsFacade
  ) {
    this.checks$ = this.facade.getChecks().pipe(
      neitherNullNorUndefined,
      map(checksCollection => checksCollection.getChecks())
    );
    this.filter$ = this.filter.asObservable();
  }

  setFilter(filter: ChecksFilter): void {
    this.filter.next(filter);
  }

  getModelVersion(): Observable<ModelVersion> {
    return this.modelVersionsFacade.selectedModelVersion();
  }

  getCheckCollection(): Observable<CheckCollection> {
    return this.facade.getChecks();
  }

  getVisibleChecks(): Observable<Check[]> {
    return combineLatest([this.checks$, this.filter$]).pipe(
      map(([checks, filter]) => {
        switch (filter.filterBy) {
          case ChecksHealthFilterOptions.all:
            return checks;
          case ChecksHealthFilterOptions.byScore:
            if (filter.scoreFilter === undefined) return checks;
            return checks.filter(check => {
              let m: boolean = true;
              let r: boolean = true;

              const metricScore = check.getMetricsScore() * 100;
              const rawScore = check.getRawScore() * 100;

              if (filter.scoreFilter.byMetric) {
                const [min, max] = filter.scoreFilter.metricScoreRange;
                m = metricScore >= min && metricScore <= max;
              }

              if (filter.scoreFilter.byRaw) {
                const [min, max] = filter.scoreFilter.rawScoreRange;
                r = rawScore >= min && rawScore <= max;
              }

              return r && m;
            });
          case ChecksHealthFilterOptions.withError:
            return checks.filter(check => check.error);
          default:
            return checks;
        }
      })
    );
  }
}

import { Injectable } from '@angular/core';
import { Observable, of, forkJoin, BehaviorSubject } from 'rxjs';
import {
  catchError,
  shareReplay,
  distinctUntilChanged,
  map,
} from 'rxjs/operators';
import { HttpService } from './data/services/http.service';
import { ServiceStatus } from '@app/core/data/types';
import { neitherNullNorUndefined, pluck } from '@app/utils';

const enum HydroServicesEndpoints {
  buildInfo = 'api/buildinfo',
  gateway = 'gateway/buildinfo',
  sonar = 'monitoring/buildinfo',
  rootcause = 'rootcause/buildinfo',
  stat = 'stat/buildinfo',
  visualization = 'visualization/buildinfo',
}

export interface BuildInfo {
  status: ServiceStatus;
  message?: string;
  [p: string]: string;
}

@Injectable({ providedIn: 'root' })
export class BuildInformationService {
  private buildInfo$: Observable<{ [serviceName: string]: BuildInfo }>;
  private buildInfo: BehaviorSubject<{
    [serviceName: string]: BuildInfo;
  }> = new BehaviorSubject<{
    [serviceName: string]: BuildInfo;
  }>({});

  constructor(private http: HttpService) {
    this.buildInfo$ = this.buildInfo
      .asObservable()
      .pipe(neitherNullNorUndefined, shareReplay(1));
  }

  loadBuildInformation() {
    const toRequest = endpoint =>
      this.http.get(endpoint).pipe(
        map((res: any) => {
          return { ...res, status: ServiceStatus.AVAILABLE };
        }),
        catchError(err => this.handleError(err)),
      );

    return forkJoin({
      build: toRequest(HydroServicesEndpoints.buildInfo),
      gateway: toRequest(HydroServicesEndpoints.gateway),
      sonar: toRequest(HydroServicesEndpoints.sonar),
      rootcause: toRequest(HydroServicesEndpoints.rootcause),
      stat: toRequest(HydroServicesEndpoints.stat),
      visualization: toRequest(HydroServicesEndpoints.visualization),
    }).subscribe(infos => this.buildInfo.next(infos));
  }

  getBuildInfo(): Observable<{ [serviceName: string]: BuildInfo }> {
    return this.buildInfo$.pipe(distinctUntilChanged());
  }

  getStatus<K extends keyof typeof HydroServicesEndpoints>(
    serviceName: K,
  ): Observable<BuildInfo> {
    return this.buildInfo$.pipe(pluck(serviceName));
  }

  private handleError(error: string): Observable<BuildInfo> {
    const is501Error = /501/i.test(error);

    if (is501Error) {
      return of({ status: ServiceStatus.CLOSED_FOR_OSS });
    } else {
      const errMsg = error || 'Something went wrong';
      return of({ status: ServiceStatus.FAILED, message: errMsg });
    }
  }
}

