import { Injectable } from '@angular/core';
import { Metric } from '@app/modules/visualization/models';
import { ColorsGeneratorFabric, ColorsGenerator } from './ColorGenerator';
import { ColoringType } from './ColoringType';

type ColorizerType = 'class_label' | 'metric';
interface ColorizerProps {
  name: string;
  data: number[];
  coloringType?: ColoringType;
  classes?: Array<string | number>;
  metric?: Metric;
}
export abstract class Colorizer {
  public type: string;
  public name: string;
  public coloringType: ColoringType;
  public classes: any[];
  protected colorsGenerator: ColorsGenerator;
  protected data: number[];

  constructor(props: ColorizerProps, colorsGenerator: ColorsGenerator) {
    this.name = props.name;
    this.data = props.data;
    this.coloringType = props.coloringType;
    this.colorsGenerator = colorsGenerator;
    this.classes = props.classes;
  }
  public getColors(): string[] {
    return this.colorsGenerator.getColors(this.data);
  }
}

class ClassLabelColorizer extends Colorizer {
  classes: Array<string | number>;
  constructor(props: ColorizerProps, colorsGenerator: ColorsGenerator) {
    super(props, colorsGenerator);
    this.type = 'ClassLabel';
    this.classes = props.classes || [];
  }
  getColors() {
    return this.colorsGenerator.getColors(this.data);
  }
}
class MetricColorizer extends Colorizer {
  constructor(props: ColorizerProps, colorsGenerator) {
    super(props, colorsGenerator);
    this.type = 'Metric';
  }

  getColors() {
    return this.colorsGenerator.getColors(this.data);
  }
}

@Injectable({ providedIn: 'root' })
export class ColorizerFabric {
  constructor(private colorGeneratorFabric: ColorsGeneratorFabric) {}
  public createColorizer(
    type: ColorizerType,
    props: ColorizerProps
  ): Colorizer | null {
    const colorGenerator = this.colorGeneratorFabric.createColorGenerator(
      type,
      props
    );

    switch (type) {
      case 'class_label':
        return new ClassLabelColorizer(props, colorGenerator);
      case 'metric':
        return new MetricColorizer(props, colorGenerator);
      default:
        return null;
    }
  }
}

import { Injectable } from '@angular/core';
import { RGBColor } from 'd3';
import * as d3 from 'd3';
import * as colorScaleChromatic from 'd3-scale-chromatic';
export type ColorMapType =
  | 'coldwarm'
  | 'interpolateRdYlBu'
  | 'redToBlue'
  | 'interpolateRainbow';

@Injectable({
  providedIn: 'root',
})
export class ColorMapService {
  getRGB({
    val,
    type = 'coldwarm',
  }: {
    val: number;
    type: ColorMapType;
  }): [number, number, number] {
    try {
      if (this.valueOutOfRange(val)) {
        throw Error(`Value must be in [0, 1] range, got: ${val}`);
      }

      switch (type) {
        case 'coldwarm':
          return this.coldwarm(val);
        case 'interpolateRdYlBu':
          return this.interpolateRdYlBu(val);
        case 'redToBlue':
          return this.redToBlue(val);
        default:
          throw Error('Unknown colormap type');
      }
    } catch (error) {
      console.warn(error);
      return [0, 0, 0];
    }
  }

  private coldwarm(val): [number, number, number] {
    const { r, g, b } = d3.color(
      colorScaleChromatic.interpolatePuBu(val)
    ) as RGBColor;

    return [r, g, b];
  }

  private interpolateRdYlBu(val): [number, number, number] {
    const { r, g, b } = d3.color(
      colorScaleChromatic.interpolateRdYlBu(1 - val)
    ) as RGBColor;

    return [r, g, b];
  }

  private valueOutOfRange(val: number): boolean {
    return val < 0 || val > 1;
  }

  private redToBlue(val: number): [number, number, number] {
    const { r, g, b } = d3.color(
      colorScaleChromatic.interpolateRdBu(1 - val)
    ) as RGBColor;

    return [r, g, b];
  }
}

