import {
  Injectable,
  Injector,
  ViewContainerRef,
  ComponentRef,
  Provider,
  ReflectiveInjector,
  ElementRef,
} from '@angular/core';
import { ComponentFactoryResolver } from '@angular/core';
import { ComponentFactory } from '@angular/core';
import { Renderer2, RendererFactory2 } from '@angular/core';
import { Observable, BehaviorSubject } from 'rxjs';

interface DialogOptions {
  component: any;
  providers?: Provider[];
  classes?: string;
  styles?: { [key: string]: string };
}

@Injectable({
  providedIn: 'root',
})
export class DialogsService {
  get show$(): Observable<boolean> {
    return this.show.asObservable();
  }
  public show: BehaviorSubject<boolean> = new BehaviorSubject(false);

  public containerElementRef: ElementRef;
  public viewContainerRef: ViewContainerRef;

  private renderer: Renderer2;

  constructor(
    private cfr: ComponentFactoryResolver,
    private parentInjector: Injector,
    rendererFactory: RendererFactory2
  ) {
    this.renderer = rendererFactory.createRenderer(null, null);
  }

  public createDialog(options: DialogOptions): void {
    const { component, providers, styles } = options;

    const cf: ComponentFactory<any> = this.cfr.resolveComponentFactory(
      component
    );
    let childInjector: ReflectiveInjector;
    let c: ComponentRef<any>;

    if (providers) {
      childInjector = ReflectiveInjector.resolveAndCreate(
        providers,
        this.parentInjector
      );
      c = cf.create(childInjector);
    } else {
      c = cf.create(this.parentInjector);
    }

    this.viewContainerRef.insert(c.hostView);

    this.setStyles(styles);
    this.openDialog();
  }

  public closeDialog(): void {
    this.show.next(false);
  }

  public clearContainer(): void {
    this.renderer.removeAttribute(
      this.containerElementRef.nativeElement,
      'style'
    );
    this.viewContainerRef.clear();
  }

  public setViewContainerRef(value: ViewContainerRef): void {
    this.viewContainerRef = value;
  }

  public setContainerElementRef(elRef: ElementRef): void {
    this.containerElementRef = elRef;
  }

  private openDialog(): void {
    this.show.next(true);
  }

  private setStyles(styles = {}): void {
    for (const key in styles) {
      if (styles.hasOwnProperty(key)) {
        this.renderer.setStyle(
          this.containerElementRef.nativeElement,
          key,
          styles[key]
        );
      }
    }
  }
}

import { Injectable, OnDestroy } from '@angular/core';
import { SnackbarService } from '@app/core/snackbar.service';
import { Explanation, ExplanationStatus } from './models';
import { RootCauseApiService } from './services';
import { RootCauseState } from './store/state';
import { merge, Observable, of, Subject, timer } from 'rxjs';
import {
  catchError,
  debounceTime,
  exhaustMap,
  switchMap,
  takeUntil,
  takeWhile,
  tap,
} from 'rxjs/operators';

@Injectable()
export class ExplanationFacade implements OnDestroy {
  private stopPoll$: Subject<any> = new Subject<any>();
  private destroy$: Subject<any> = new Subject<any>();
  private readonly pollingInterval = 5000;

  constructor(
    private readonly state: RootCauseState,
    private readonly api: RootCauseApiService,
    private readonly snackbar: SnackbarService,
  ) {}

  ngOnDestroy() {
    this.destroy$.next();
    this.destroy$.complete();
  }

  createExplanation(
    model_version_id,
    explained_request_id,
    method = 'anchor',
    output_field,
  ): void {
    this.api
      .createExplanation({
        explained_request_id,
        method,
        model_version_id: model_version_id,
        output_field,
      })
      .pipe(
        switchMap(() =>
          this.poll(model_version_id, explained_request_id, output_field),
        ),
        takeUntil(this.destroy$),
      )
      .subscribe(
        explanation => this.state.setExplanation(explanation),
        error => {
          console.error(error);
          this.state.setExplanation({
            state: ExplanationStatus.failed,
            description: `Internal error was occurred`,
          });
        },
      );
  }

  getExplanation(): Observable<Explanation | null> {
    return this.state.getExplanation();
  }

  loadExplanation(
    requestId,
    modelVersionId,
    method = 'anchor',
    output_field,
  ): void {
    this.api
      .getExplanation({
        explained_request_id: requestId,
        method,
        model_version_id: modelVersionId,
        output_field,
      })
      .pipe(
        tap(_ => this.stopPoll$.next()),
        switchMap(explanation => {
          switch (explanation.state) {
            case ExplanationStatus.failed:
            case ExplanationStatus.notCalled:
            case ExplanationStatus.success:
            case ExplanationStatus.notSupported:
              return of(explanation);
            default:
              return this.poll(modelVersionId, requestId, output_field);
          }
        }),
        catchError(err =>
          of<Explanation>({
            state: ExplanationStatus.failed,
            description: `Internal error was occurred`,
          }),
        ),
      )
      .subscribe(
        explanation => this.state.setExplanation(explanation),
        error => {
          console.error(error);
          this.state.setExplanation({
            state: ExplanationStatus.failed,
            description: `Internal error was occurred`,
          });
        },
      );
  }

  private poll(model_version_id, explained_request_id, output_field) {
    return timer(0, this.pollingInterval).pipe(
      debounceTime(this.pollingInterval / 2),
      exhaustMap(() =>
        this.api.getExplanation({
          model_version_id,
          explained_request_id,
          method: 'anchor',
          output_field,
        }),
      ),
      takeWhile(exp => exp.state !== ExplanationStatus.success, true),
      takeUntil(merge(this.destroy$, this.stopPoll$)),
    );
  }
}

