import { Injectable } from '@angular/core';
import { ModelVersionsFacade } from '@app/core/facades/model-versions.facade';
import { ProfilerFacade } from '@app/core/facades/profiler.facade';
import { Observable } from 'rxjs';
import { switchMap, map } from 'rxjs/operators';

@Injectable({
  providedIn: 'root',
})
export class FieldsService {
  private readonly _fields: Observable<any>;

  constructor(
    private readonly modelVersionsFacade: ModelVersionsFacade,
    private readonly profilerFacade: ProfilerFacade
  ) {
    this._fields = modelVersionsFacade.selectedModelVersion().pipe(
      switchMap(mv =>
        profilerFacade.loadFields(`${mv.id}`).pipe(
          map(fields => {
            const withoutIndex = s => s.slice(0, s.lastIndexOf('_'));
            const dict = new Map<string, string[]>();

            return fields.reduce(function (prev, nameWithIndex) {
              const bareName = withoutIndex(nameWithIndex);
              return prev.has(bareName)
                ? prev.set(bareName, [...prev.get(bareName), nameWithIndex])
                : prev.set(bareName, [nameWithIndex]);
            }, dict);
          })
        )
      )
    );
  }

  getFields(): Observable<Map<string, string[]>> {
    return this._fields;
  }
}

import { Injectable } from '@angular/core';
import { Metric } from '@app/modules/visualization/models';
import { ColorMapService } from '@app/core/color-map.service';
import { ColoringType } from './ColoringType';

import { SCATTER_PLOT_PALETTE } from './ScatterPlotPalette';
export class ColorsGenerator {
  getColors(data: number[]): string[] {
    return data.map(() => '#00498e');
  }
}

@Injectable()
class GradientColorsGenerator extends ColorsGenerator {
  private colorMapService: ColorMapService;
  constructor() {
    super();
    this.colorMapService = new ColorMapService();
  }
  public getColors(data: number[]) {
    return data.map(val => {
      const [r, g, b] = this.colorMapService.getRGB({
        val,
        type: 'redToBlue',
      });
      return `rgb(${r}, ${g}, ${b})`;
    });
  }
}

class ClassLabelsColorsGenerator extends ColorsGenerator {
  private classes: Array<string | number>;
  constructor(classes: Array<string | number>) {
    super();
    this.classes = classes || [];
  }
  getColors(data: number[]) {
    return data.map(val => {
      return SCATTER_PLOT_PALETTE[this.classes.indexOf(val)];
    });
  }
}

class MetricColorsGenerator implements ColorsGenerator {
  metric: Metric;
  constructor(metric: Metric) {
    this.metric = metric;
  }
  public getColors(data: number[]) {
    const { scores, operation, threshold } = this.metric;
    const [successColor, failedColor] = ['#418ecc', '#ff716c'];
    return scores.map(score => {
      switch (operation) {
        case 'Eq':
          return score === threshold ? successColor : failedColor;
        case 'NotEq':
          return score !== threshold ? successColor : failedColor;
        case 'Greater':
          return score > threshold ? successColor : failedColor;
        case 'Less':
          return score < threshold ? successColor : failedColor;
        case 'GreaterEq':
          return score >= threshold ? successColor : failedColor;
        case 'LessEq':
          return score <= threshold ? successColor : failedColor;
        default:
          return successColor;
      }
    });
    return [];
  }
}

@Injectable({ providedIn: 'root' })
export class ColorsGeneratorFabric {
  public createColorGenerator(
    type: 'class_label' | 'metric',
    props: {
      coloringType?: ColoringType;
      classes?: Array<string | number>;
      metric?: Metric;
    }
  ): ColorsGenerator {
    switch (type) {
      case 'class_label':
        switch (props.coloringType) {
          case 'class':
            return new ClassLabelsColorsGenerator(props.classes);
          case 'gradient':
            return new GradientColorsGenerator();
        }
      case 'metric':
        return new MetricColorsGenerator(props.metric);
      default:
        return new ColorsGenerator();
    }
  }
}

import {
  HttpClient,
  HttpErrorResponse,
  HttpParams,
} from '@angular/common/http';
import { Injectable, Inject } from '@angular/core';
import { HS_BASE_URL } from '@app/core/base-url.token';
import { Observable, throwError } from 'rxjs';
import { catchError } from 'rxjs/operators';

type HydroHttpParams =
  | string
  | { [param: string]: string | string[] }
  | HttpParams;

interface IHydroHttpOptions {
  headers?: any;
  params?: HydroHttpParams;
  [propName: string]: any;
}

@Injectable({
  providedIn: 'root',
})
export class HttpService {
  constructor(
    public http: HttpClient,
    @Inject(HS_BASE_URL) public url: string
  ) {}

  get<T>(url: string, options?: IHydroHttpOptions) {
    return this.http
      .get<T>(this.getFullUrl(url), this.hydroOptions(options))
      .pipe(catchError(err => this.handleError(err)));
  }

  delete(url: string, options?: IHydroHttpOptions) {
    return this.http
      .delete(this.getFullUrl(url), this.hydroOptions(options))
      .pipe(catchError(err => this.handleError(err)));
  }

  post<T>(url: string, body, options?: IHydroHttpOptions) {
    return this.http
      .post<T>(this.getFullUrl(url), body, this.hydroOptions(options))
      .pipe(catchError(this.handleError));
  }

  put(url: string, body, options?: IHydroHttpOptions) {
    return this.http
      .put(this.getFullUrl(url), body, this.hydroOptions(options))
      .pipe(catchError(err => this.handleError(err)));
  }

  public getFullUrl(endpoint: string): string {
    return this.url + endpoint;
  }

  private handleError(error: HttpErrorResponse): Observable<never> {
    let message: string;
    if (error.error instanceof ErrorEvent) {
      message = `An error occurred: ${error.error.message}`;
    } else {
      const status: number = error.status;

      let err: string = error.name;
      let information: string = error.message;
      if (error.error) {
        err = error.error.error || error.name || '';
        information = error.error.information || error.error.message || '';
      }

      message = `status: ${status}, error: ${err}, message: ${information} `;
    }
    return throwError(message);
  }

  private hydroOptions(options: IHydroHttpOptions = {}) {
    if (options === null) {
      return {};
    }

    const res = {
      ...options,
      params: this.createHttpParams(options.params),
    };

    return res;
  }

  private createHttpParams(
    params: string | { [param: string]: string | string[] } | HttpParams = ''
  ): HttpParams {
    if (params instanceof HttpParams) {
      return params;
    } else if (typeof params === 'string') {
      return new HttpParams({ fromString: params });
    } else if (typeof params === 'object') {
      for (const key in params) {
        if (params.hasOwnProperty(key)) {
          if (params[key] === undefined) {
            delete params[key];
          }
        }
      }
      return new HttpParams({ fromObject: params });
    }
  }
}

