import { Injectable } from '@angular/core';
import { Inject } from '@angular/core';

import { Observable } from 'rxjs';
import { scan, finalize, share } from 'rxjs/operators';

import { environment } from 'environments/environment';
import { HS_BASE_URL } from '@app/core/base-url.token';

type logType = 'servable' | 'model-version';

@Injectable({
  providedIn: 'root',
})
export class LogService {
  constructor(@Inject(HS_BASE_URL) private baseUrl: string) {}

  getLog(type: logType, param: string): Observable<string> {
    let eventSource: EventSource;

    const logStream$ = new Observable<string>(subscribe => {
      const { apiUrl } = environment;
      let url: string;

      switch (type) {
        case 'servable':
          url = `${this.baseUrl}${apiUrl}/servable/${param}/logs?follow=true`;
          break;
        case 'model-version':
          url = `${this.baseUrl}${apiUrl}/model/version/${param}/logs?follow=true`;
          break;
      }
      eventSource = new EventSource(url, {
        withCredentials: true,
      });

      eventSource.addEventListener('EndOfStream', () => {
        eventSource.close();
        subscribe.complete();
      });

      eventSource.addEventListener('Log', ({ data }: MessageEvent) => {
        if (data) {
          subscribe.next(data);
        }
      });

      eventSource.addEventListener('message', ({ data }: MessageEvent) => {
        if (data) {
          subscribe.next(data);
        }
      });

      eventSource.onerror = err => {
        subscribe.error(err);
      };
    });

    return logStream$.pipe(
      share(),
      finalize(() => {
        eventSource.close();
      })
    );
  }
}

import {
  ComponentFactoryResolver,
  ComponentRef,
  Injectable,
  ViewContainerRef,
} from '@angular/core';
import { ModelVersionLogComponent } from '@app/modules/model-version/components';
import { ServableLogsComponent } from '@app/modules/servables/containers';
import { BehaviorSubject, Observable } from 'rxjs';

@Injectable({
  providedIn: 'root',
})
export class LogsService {
  public viewContainerRef: ViewContainerRef;
  private current: ComponentRef<
    ModelVersionLogComponent | ServableLogsComponent
  >;

  private logIsVisible: BehaviorSubject<boolean> = new BehaviorSubject<boolean>(
    false
  );
  public logIsVisible$: Observable<boolean> = this.logIsVisible.asObservable();

  constructor(private resolver: ComponentFactoryResolver) {}

  public showBuildLog(modelVersionId: number) {
    this.viewContainerRef.clear();
    const factory = this.resolver.resolveComponentFactory(
      ModelVersionLogComponent
    );
    const component = this.viewContainerRef.createComponent(factory);

    this.current = component;
    component.instance.modelVersion = modelVersionId;
    component.instance.closed.subscribe(() => this.closeGlobalLog());
    component.changeDetectorRef.detectChanges();
    this.toggleGlobalLog();
  }

  public showServableLogs(name: string) {
    this.viewContainerRef.clear();
    const factory = this.resolver.resolveComponentFactory(
      ServableLogsComponent
    );
    const component = this.viewContainerRef.createComponent(factory);
    this.current = component;
    component.instance.servableName = name;
    component.instance.closed.subscribe(() => this.closeGlobalLog());
    component.changeDetectorRef.detectChanges();
    this.toggleGlobalLog();
  }

  public toggleGlobalLog(): void {
    this.logIsVisible.next(!this.logIsVisible.value);
  }

  public closeGlobalLog(): void {
    this.current.destroy();
    this.viewContainerRef.clear();
    this.logIsVisible.next(false);
  }

  public setViewContainerRef(value: ViewContainerRef): void {
    this.viewContainerRef = value;
  }
}

