import { Injectable } from '@angular/core';
import { Store, select } from '@ngrx/store';
import { neitherNullNorUndefined } from '@app/utils';

import { Observable, combineLatest } from 'rxjs';
import { map } from 'rxjs/operators';

import { ModelVersionStatus, ModelVersion, Model } from '@app/core/data/types';

import {
  selectAllModelVersions,
  selectFirstModel,
  selectModelsLoaded,
  selectModelsWithReleasedVersions,
} from '@app/core/store/selectors';
import { HydroServingState } from '../store/states/root.state';
import {
  GetModels,
  DeleteModel,
  ToggleFavorite,
} from '../store/actions/models.actions';

import {
  selectAllModels,
  selectSelectedModel,
  selectNonMetricModels,
} from '../store/selectors/models.selectors';

@Injectable({ providedIn: 'root' })
export class ModelsFacade {
  constructor(private readonly store: Store<HydroServingState>) {}

  loadAll(): void {
    this.store.dispatch(GetModels());
  }

  deleteModel(modelId: number): void {
    this.store.dispatch(DeleteModel({ modelId }));
  }

  allModels(): Observable<Model[]> {
    return this.store.pipe(select(selectAllModels));
  }

  modelsWithReleasedVersions(): Observable<Model[]> {
    return this.store.pipe(select(selectModelsWithReleasedVersions));
  }

  firstModel(): Observable<Model> {
    return this.store.pipe(select(selectFirstModel));
  }

  selectedModel(): Observable<Model> {
    return this.store
      .pipe(select(selectSelectedModel))
      .pipe(neitherNullNorUndefined);
  }

  nonMetricModels(): Observable<Model[]> {
    return this.store.pipe(select(selectNonMetricModels));
  }

  someModelVersionIsReleased(): Observable<boolean> {
    return this.store.pipe(
      select(selectAllModelVersions),
      map(modelVersions =>
        modelVersions.some(
          ({ status }) => status === ModelVersionStatus.Released,
        ),
      ),
    );
  }

  selectedModelVersions(): Observable<ModelVersion[]> {
    const selectedModel$ = this.selectedModel();
    const selectedModelVersions$ = this.store.pipe(
      select(selectAllModelVersions),
    );

    return combineLatest([selectedModel$, selectedModelVersions$]).pipe(
      map(([model, modelVersions]) => {
        return modelVersions.filter(mv => mv.model.id === model.id);
      }),
    );
  }

  toggleFavorite(model: Model) {
    this.store.dispatch(ToggleFavorite({ model }));
  }

  areModelsLoaded(): Observable<boolean> {
    return this.store.pipe(select(selectModelsLoaded));
  }
}

import { Injectable } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';
import { Store, select } from '@ngrx/store';
import { Observable } from 'rxjs';
import { map, first } from 'rxjs/operators';
import { ModelsFacade } from '@app/core/facades/models.facade';
import { Model, ModelVersion } from '@app/core/data/types';
import { ModelVersionsFacade } from '@app/core/facades/model-versions.facade';
import { HydroServingState } from '@app/core/store/states/root.state';
import { selectRouterState } from '@app/core/store/selectors/router.selectors';
import { DialogsService } from '@app/modules/dialogs/dialogs.service';

import {
  DialogDeleteModelComponent,
  SELECTED_MODEL,
} from '@app/modules/dialogs/components';

@Injectable()
export class ModelsHeaderService {
  siblings$: Observable<ModelVersion[]>;

  constructor(
    private readonly route: ActivatedRoute,
    private readonly router: Router,
    private readonly store: Store<HydroServingState>,
    private readonly facade: ModelsFacade,
    private readonly modelVersionsFacade: ModelVersionsFacade,
    private readonly dialog: DialogsService
  ) {
    this.siblings$ = this.modelVersionsFacade.siblingModelVersions();
  }

  isButtonShowed(): Observable<boolean> {
    return this.store.pipe(
      select(selectRouterState),
      map(state => this.isRootUrl(state.state.url))
    );
  }

  getModel(): Observable<Model> {
    return this.facade.selectedModel();
  }

  getModelVersion(): Observable<ModelVersion> {
    return this.modelVersionsFacade.selectedModelVersion();
  }

  getSiblings(): Observable<ModelVersion[]> {
    return this.modelVersionsFacade.siblingModelVersions();
  }

  getService(): Observable<string> {
    return this.store.pipe(
      select(selectRouterState),
      map(state => {
        const urlArray = state.state.url.split('/');
        const serviceIndexInArray = 4;
        return (
          urlArray[serviceIndexInArray] &&
          urlArray[serviceIndexInArray].replace('_', ' ').split('?')[0]
        );
      })
    );
  }

  onClickModel(): void {
    const [, root, modelName] = this.router.url.split('/');
    this.router.navigate([root, modelName]);
  }

  onClickModelVersion(): void {
    const [, root, modelName, modelVersionNumber] = this.router.url.split('/');
    this.router.navigate([root, modelName, modelVersionNumber], {
      queryParamsHandling: 'merge',
    });
  }

  onClickSibling(modelVersion: ModelVersion): void {
    const [, root, modelName, , ...tail] = this.router.url.split('/');
    this.router.navigate([root, modelName, modelVersion.modelVersion, ...tail]);
  }

  onDelete() {
    this.getModel()
      .pipe(first())
      .subscribe(model => {
        this.dialog.createDialog({
          component: DialogDeleteModelComponent,
          providers: [{ provide: SELECTED_MODEL, useValue: model }],
        });
      });
  }

  private isRootUrl(url: string): boolean {
    return url.split('/').length === 3;
  }
}

import { Injectable } from '@angular/core';
import { ModelsFacade } from '@app/core/facades/models.facade';
import { Observable, BehaviorSubject, combineLatest } from 'rxjs';
import { switchMap } from 'rxjs/operators';
import { map } from 'rxjs/operators';
import { Model } from '@app/core/data/types';

@Injectable({
  providedIn: 'root',
})
export class ModelsSidebarService {
  private readonly allModels$: Observable<Model[]>;
  private readonly nonMetricModels$: Observable<Model[]>;

  private _metricModelsAreHidden = new BehaviorSubject<boolean>(true);
  private _filterString = new BehaviorSubject('');

  constructor(private readonly facade: ModelsFacade) {
    this.allModels$ = facade.allModels();
    this.nonMetricModels$ = facade.nonMetricModels();
  }

  metricModelsAreHidden(): Observable<boolean> {
    return this._metricModelsAreHidden.asObservable();
  }

  private models(): Observable<Model[]> {
    return this.metricModelsAreHidden().pipe(
      switchMap(hidden => {
        return hidden ? this.nonMetricModels$ : this.allModels$;
      }),
    );
  }

  filterString(): Observable<string> {
    return this._filterString.asObservable();
  }

  filteredModels(): Observable<Model[]> {
    return combineLatest([this.models(), this.filterString()]).pipe(
      map(([models, filterStr]) => {
        let filtered: Model[] = models;
        if (filterStr) {
          filtered = models.filter(model => model.name.includes(filterStr));
        }
        return filtered;
      }),
    );
  }

  nonFavoriteModels(): Observable<Model[]> {
    return this.filteredModels().pipe(
      map(models => models.filter(model => !model.favorite)),
    );
  }

  favoriteModels(): Observable<Model[]> {
    return this.filteredModels().pipe(
      map(models => models.filter(model => model.favorite)),
    );
  }

  visibleModels(): Observable<Model[]> {
    return combineLatest([
      this.favoriteModels(),
      this.nonFavoriteModels(),
    ]).pipe(
      map(([fav, nonFav]) => {
        return [...fav, ...nonFav];
      }),
    );
  }

  changeFilter(str: string): void {
    this._filterString.next(str);
  }

  changeMetricModelsHide(hide: boolean): void {
    this._metricModelsAreHidden.next(hide);
  }
}

