import { Injectable } from '@angular/core';
import { FormControl, FormGroup } from '@angular/forms';
import { Observable } from 'rxjs';

import { CustomValidatorsService } from '@app/core/custom-validators.service';
import { ModelsFacade } from '@app/core/facades/models.facade';
import { ModelVersionsFacade } from '@app/core/facades/model-versions.facade';
import { DeploymentConfigsFacade } from '@app/core/facades/deployment-configs.facade';
import {
  DeploymentConfig,
  ModelVariant,
  ModelVersion,
} from '@app/core/data/types';

export interface ModelVariantFormData {
  weight: number;
  modelId?: number;
  modelVersion: ModelVersion;
  deploymentConfigName: string;
}

@Injectable()
export class ModelVariantFormService {
  constructor(
    private readonly modelVersionsFacade: ModelVersionsFacade,
    private readonly modelsFacade: ModelsFacade,
    private readonly depConfigsFacade: DeploymentConfigsFacade,
    private readonly customValidators: CustomValidatorsService,
  ) {}

  defaultModelVariantFormData(
    modelVersions: ModelVersion[],
    depConfig: DeploymentConfig,
  ): ModelVariantFormData {
    return {
      weight: 100,
      modelId: modelVersions[0].model.id,
      modelVersion: modelVersions[0],
      deploymentConfigName: depConfig.name,
    };
  }

  modelVariantToModelVariantFormData(
    modelVariant: ModelVariant,
    modelVersions: ModelVersion[],
  ): ModelVariantFormData {
    const modelVersion = modelVersions.find(
      mv => mv.id === modelVariant.modelVersionId,
    );

    return {
      weight: modelVariant.weight,
      modelId: modelVersion.model.id,
      modelVersion: modelVersion,
      deploymentConfigName: modelVariant.deploymentConfigurationName,
    };
  }

  buildModelVariantFormGroup(
    modelVariantFormData: ModelVariantFormData = this.defaultModelVariantFormData(
      [],
      null,
    ),
  ): FormGroup {
    return new FormGroup({
      weight: new FormControl(modelVariantFormData.weight, [
        this.customValidators.required(),
        this.customValidators.pattern(/^[0-9]+$/),
      ]),
      modelId: new FormControl(
        modelVariantFormData.modelId,
        this.customValidators.required(),
      ),
      modelVersion: new FormControl(
        modelVariantFormData.modelVersion,
        this.customValidators.required(),
      ),
      deploymentConfigName: new FormControl(
        modelVariantFormData.deploymentConfigName,
        this.customValidators.required(),
      ),
    });
  }

  getDeploymentConfigs(): Observable<DeploymentConfig[]> {
    return this.depConfigsFacade.getAll();
  }
}

import { Injectable } from '@angular/core';
import {
  ModelVersion,
  ModelVersionStatus,
  ModelVersionDTO,
} from '../types/model-version';
import { ModelSignature } from '@app/core/data/types';

@Injectable({
  providedIn: 'root',
})
export class ModelVersionBuilder {
  public build(props: any): ModelVersion {
    return this.toModelVersion(props);
  }

  private toModelVersion(props: ModelVersionDTO): ModelVersion {
    return new ModelVersion({
      id: props.id,
      image: props.image,
      created: props.created,
      finished: props.finished,
      modelVersion: props.modelVersion,
      modelSignature: new ModelSignature(props.modelSignature),
      runtime: props.runtime,
      model: props.model,
      status:
        (props.status && ModelVersionStatus[props.status]) ||
        ModelVersionStatus.Undefined,
      applications: props.applications || [],
      metadata: props.metadata || {},
      isExternal: props.isExternal,
    });
  }
}

properties.defaultValue:
createEffect(() =>
    this.actions$.pipe(
      ofType(AddSuccess),
      withLatestFrom(this.store.pipe(select(selectModelVersionEntities))),
      exhaustMap(([{ payload: application }, modelVersionsDict]) => {
        const stages = application.executionGraph.stages;

        const variants: ModelVariant[] = _.flatMap(
          stages,
          (stage: Stage) => stage.modelVariants,
        );
        const ids = _.map(variants, (mv: ModelVariant) => mv.modelVersionId);
        const modelVersions = ids.map(id => modelVersionsDict[id]);

        const modelVersionsUpdated = modelVersions.map(mv => {
          return mv.addApplication(application.name);
        });

        return of(GetModelVersionsSuccess({ payload: modelVersionsUpdated }));
      }),
    ),
  )

createEffect(() =>
    this.actions$.pipe(
      ofType(AddModelVersion),
      withLatestFrom(this.store.pipe(select(selectAllModels))),
      exhaustMap(([{ modelVersion }, models]) => {
        const modelExist = models.some(
          model => model.name === modelVersion.model.name,
        );

        if (modelExist) {
          return of(UpsertModelVersion({ modelVersion }));
        } else {
          const model = this.modelBuilder.build(modelVersion.model);

          return concat(
            of(AddModel({ model })),
            of(UpsertModelVersion({ modelVersion })),
          );
        }
      }),
    ),
  )

createEffect(() =>
    this.actions$.pipe(
      ofType(DeleteModelVersionSuccess),
      switchMap(_ => of(NotifyWarning(`Model version: ${_} has been deleted`))),
    ),
  )

createEffect(() =>
    this.actions$.pipe(
      ofType(GetModelVersions),
      switchMap(() =>
        this.modelVersionsService.getAllVersions().pipe(
          switchMap(data => {
            const modelVersions = data.map(
              this.modelVersionBuilder.build,
              this.modelVersionBuilder,
            );

            const models: Model[] = _.uniqBy(
              modelVersions.map(mv => mv.model),
              function (model: ModelDTO) {
                return model.id;
              },
            )
              .map(this.modelBuilder.build, this.modelBuilder)
              .map(model => {
                return {
                  ...model,
                  favorite: this.favoriteService.isFavorite(model.name),
                };
              });

            return of(
              GetModelVersionsSuccess({ payload: modelVersions }),
              GetModelsSuccess({ payload: models }),
            );
          }),
          catchError(error => {
            console.error(error);

            return of(
              GetModelVersionsFail({ error }),
              NotifyError('Failed to load model versions'),
            );
          }),
        ),
      ),
    ),
  )

createEffect(() =>
    this.actions$.pipe(
      ofType(UpsertModelVersion),
      map(({ modelVersion }) => {
        switch (modelVersion.status) {
          case ModelVersionStatus.Failed:
            return NotifyError(
              `Model version: ${modelVersion.nameWithId()} failed`,
            );

          case ModelVersionStatus.Released:
            return NotifySuccess(
              `Model version: ${modelVersion.nameWithId()} has been released`,
            );
