import { Injectable } from '@angular/core';
import { BehaviorSubject, Observable } from 'rxjs';
import { map, distinctUntilChanged } from 'rxjs/operators';
import { Stat } from '../models';

interface State {
  loading: boolean;
  error: string | null;
  stat: Stat | null;
}

const initialState: State = {
  loading: false,
  error: null,
  stat: null,
};

@Injectable()
export class StatState {
  private state$: Observable<State>;
  private state: BehaviorSubject<State> = new BehaviorSubject<State>(
    initialState
  );

  constructor() {
    this.state$ = this.state.asObservable();
  }

  getStat(): Observable<Stat | null> {
    return this.state$.pipe(
      map(({ stat }) => stat),
      distinctUntilChanged()
    );
  }

  isLoading(): Observable<boolean> {
    return this.state$.pipe(
      map(({ loading }) => loading),
      distinctUntilChanged()
    );
  }

  getError(): Observable<string | null> {
    return this.state$.pipe(
      map(({ error }) => error),
      distinctUntilChanged()
    );
  }

  initLoading(): void {
    this.state.next({ ...initialState, loading: true });
  }

  setError(error: string | null): void {
    const state = this.state.getValue();
    this.state.next({ ...state, error, loading: false });
  }

  setStat(stat: Stat): void {
    const state = this.state.getValue();
    this.state.next({ ...state, stat, loading: false });
  }
}

import { HttpClient, HttpErrorResponse } from '@angular/common/http';
import { Injectable, Inject } from '@angular/core';
import { APP_BASE_HREF } from '@angular/common';

import { of } from 'rxjs';
import { catchError } from 'rxjs/operators';

@Injectable({
  providedIn: 'root',
})
export class SvgSpriteService {
  constructor(
    private http: HttpClient,
    @Inject(APP_BASE_HREF) private href: string
  ) {}

  public loadSvgSprite() {
    if (
      !document.createElementNS ||
      !document.createElementNS('http://www.w3.org/2000/svg', 'svg')
        .createSVGRect
    ) {
      return true;
    }

    const fileUrl = 'assets/images/sprites/hydro-sprite.svg';
    const url = this.href + fileUrl;

    this.http
      .get(url, { observe: 'body', responseType: 'text' })
      .pipe(
        catchError((err: HttpErrorResponse) => {
          console.error(`Can't load svg sprite. Error: ${err.message}`);
          return of('');
        })
      )
      .subscribe(res => {
        const insert = () =>
          document.body.insertAdjacentHTML('afterbegin', res);

        document.body
          ? insert()
          : document.addEventListener('DOMContentLoaded', insert);
      });
  }
}

