import { ModelVersion } from '@app/core/data/types';
import { AggregationDTO } from './AggregationDTO';

export interface AggregationCheck {
  checked: number;
  passed: number;
}

export class Aggregation {
  readonly from: any;
  readonly to: any;
  readonly id: string;
  readonly hs_requests: number;
  readonly modelVersionId: number;
  readonly metricsChecks: { [metricName: string]: AggregationCheck };
  readonly batchesChecks: {
    [featureName: string]: {
      [metricName: string]: AggregationCheck;
    };
  };
  readonly featuresChecks: { [featureName: string]: AggregationCheck };
  readonly modelVersion: ModelVersion;

  constructor(params: AggregationDTO, modelVersion: ModelVersion) {
    this.id = params._id;
    this.hs_requests = params._hs_requests || 0;
    this.metricsChecks = params._hs_metrics || {};
    this.batchesChecks = params._hs_batch || {};
    this.featuresChecks = Aggregation.extractFeatureChecks(params);
    this.from = params._hs_first_id;
    this.to = params._hs_last_id;
    this.modelVersionId = params._hs_model_version_id;
    this.modelVersion = modelVersion;
  }

  private static extractFeatureChecks(params: any): {
    [featureName: string]: AggregationCheck;
  } {
    const featuresChecks = Object.create(null);

    for (const featureNameKey in params) {
      if (params.hasOwnProperty(featureNameKey)) {
        if (!featureNameKey.startsWith('_')) {
          const check: { checks: number; passed: number } =
            params[featureNameKey];
          featuresChecks[featureNameKey] = {
            checked: check.checks,
            passed: check.passed,
          };
        }
      }
    }

    return featuresChecks;
  }

  get inputFeaturesNames(): string[] {
    return this.modelVersion.contractInputs.map(input => input.name);
  }

  get outputFeaturesNames(): string[] {
    return this.modelVersion.contractOutputs.map(output => output.name);
  }
}

import { Aggregation } from './Aggregation';
import { union, isEmpty } from 'lodash';
import { compose } from 'lodash/fp';

export class AggregationsList {
  aggregations: Aggregation[] = [];
  readonly totalBatchesCount: number;
  readonly showedBatchesCount: number;
  readonly minDate: Date;
  readonly maxDate: Date;
  constructor(
    aggregations: Aggregation[] = [],
    batchesCount: number = 0,
    minDate: number,
    maxDate: number
  ) {
    this.aggregations = aggregations;
    this.totalBatchesCount = batchesCount;
    this.showedBatchesCount = aggregations.length;
    this.minDate = new Date(minDate * 1000);
    this.maxDate = new Date(maxDate * 1000);
  }

  get featureNames(): string[] {
    const firstAggregation = this.aggregations[0];

    return firstAggregation ? Object.keys(firstAggregation.featuresChecks) : [];
  }

  get inputNames(): string[] {
    const firstAggregation = this.aggregations[0];

    return firstAggregation ? firstAggregation.inputFeaturesNames : [];
  }

  get outputNames(): string[] {
    const firstAggregation = this.aggregations[0];

    return firstAggregation ? firstAggregation.outputFeaturesNames : [];
  }

  get metricNames(): string[] {
    if (this.aggregations.length > 0) {
      const set = new Set<string>();
      this.aggregations.forEach(agg => {
        Object.keys(agg.metricsChecks).forEach(metricName =>
          set.add(metricName)
        );
      });
      return [...set];
    }
    return [];
  }

  get batchNames(): string[] {
    return this.aggregations
      .filter(agg => !isEmpty(agg.batchesChecks))
      .reduce((names, { batchesChecks }) => {
        return union(names, Object.keys(Object.values(batchesChecks)[0]));
      }, []);
  }

  get dateFrom(): Date | null {
    if (this.aggregations.length) {
      return this.extractDateFromId(this.aggregations[0].id);
    }
    return null;
  }
  get dateTo(): Date | null {
    if (this.aggregations.length) {
      return this.extractDateFromId(
        this.aggregations[this.aggregations.length - 1].id
      );
    }
    return null;
  }

  get lastAggregation(): Aggregation | null {
    if (this.aggregations.length) {
      return this.aggregations[this.aggregations.length - 1];
    } else {
      return null;
    }
  }

  has(aggregation: Aggregation | null): boolean {
    if (
      this.aggregations.length &&
      aggregation !== null &&
      aggregation !== undefined
    ) {
      return this.aggregations.some(({ id }) => id === aggregation.id);
    } else {
      return false;
    }
  }

  private extractDateFromId(id: string): Date {
    const getFirst4Bytes = str => str.slice(0, 8);
    const convertToMicroseconds = str => parseInt(str, 16) * 1000;
    const convertToDate = ms => new Date(ms);

    return compose(convertToDate, convertToMicroseconds, getFirst4Bytes)(id);
  }
}

import { DeploymentConfig } from './deployment-config';
import { Signature } from '@app/core/data/types/signature';

export interface ApplicationCreatingRequest {
  name: string;
  kafkaStreaming: any[];
  executionGraph: {
    stages: {
      modelVariants: {
        modelVersionId: number;
        weight: number;
      }[];
    }[];
  };
  deploymentConfiguration: DeploymentConfig;
}

export interface ApplicationUpdateRequest {
  name: string;
  kafkaStreaming?: any[];
  executionGraph: {
    stages: {
      modelVariants: {
        modelVersionId: number;
        weight: number;
        deploymentConfigName: string;
      }[];
    }[];
  };
  deploymentConfiguration: DeploymentConfig;
}

export interface KafkaStreaming {
  sourceTopic: string;
  destinationTopic: string;
  consumerId?: string;
  errorTopic?: string;
}

export enum TestStatus {
  Failed = 'failed',
  Pending = 'pending',
  Success = 'success',
  Undefined = '',
}

export enum ApplicationStatus {
  Assembling = 'assembling',
  Ready = 'ready',
  Failed = 'failed',
  Undefined = 'undefined',
}

export interface Stage {
  modelVariants: ModelVariant[];
  signature: string;
}

export interface ModelVariant {
  servableName?: string;
  modelVersionId: number;
  weight: number;
  deploymentConfigurationName: string;
}

export interface ExecutionGraph {
  stages: Stage[];
}

export class Application {
  id?: number;
  signature?: Signature;
  name: string;
  executionGraph: ExecutionGraph;
  namespace?: string;
  kafkaStreaming?: KafkaStreaming[];
  input: string;
  output: string;
  testStatus?: TestStatus;
  error?: string;
  status: string;
  message?: string;
  favorite: boolean;
  deploymentConfiguration: DeploymentConfig;

  constructor(props: any = {}) {
    if (props.id) {
      this.id = props.id;
    }
    if (props.signature) {
      this.signature = props.signature;
    }
    this.name = props.name;
    this.executionGraph = props.executionGraph;
    this.kafkaStreaming = props.kafkaStreaming;
    this.input = props.input || null;
    this.output = props.output || null;
    this.namespace = props.namespace || null;
    this.testStatus = props.testStatus || null;
    this.error = props.error || '';
    this.testStatus = props.testStatus || TestStatus.Undefined;
    this.status = props.status;
    this.message = props.message;
    this.favorite = props.favorite || false;
    this.deploymentConfiguration = props.deploymentConfiguration;
  }
}

