import * as _ from 'lodash';
import { BareCheck } from './BareCheck';

export type CheckId = string;
export interface MetricCheck {
  check: boolean;
  description: string;
  threshold: number;
  value: number;
  metricSpecId: string;
}
export interface RawCheck {
  operator?: string;
  check: boolean;
  description: string;
  threshold: number;
  value: number;
  metricSpecId: string;
}

export class Check {
  id: CheckId;
  error: string | null;
  latency: number;
  overallScore: number;
  metricChecks: { [metricName: string]: MetricCheck };
  rawChecks: {
    overall: RawCheck[];
  };
  modelVersionId: number;
  modelVersion: number;
  modelName: string;
  inputsOutputs: { [IOkey: string]: any };
  timestamp: number;

  constructor(params: BareCheck) {
    this.id = params._id;
    this.error = params._hs_error;
    this.latency = params._hs_latency;
    this.overallScore = params._hs_overall_score;
    this.metricChecks = params._hs_metric_checks || {};
    this.rawChecks = params._hs_raw_checks || { overall: [] };
    this.modelVersionId = params._hs_model_version_id;
    this.modelName = params._hs_model_name;
    this.modelVersion = params._hs_model_incremental_version;
    this.timestamp = params._hs_timestamp;
    this.inputsOutputs = this.getInputsOutputs(params);
  }

  isFailed(): boolean {
    return this.overallScore < 1;
  }

  hasMetricChecks(): boolean {
    return Object.keys(this.metricChecks).length > 0;
  }

  private getInputsOutputs(bareCheck: BareCheck) {
    const res = Object.create(null);

    for (const fieldName in bareCheck) {
      if (bareCheck.hasOwnProperty(fieldName) && !fieldName.startsWith('_')) {
        res[fieldName] = bareCheck[fieldName];
      }
    }

    return res;
  }

  getMetricsScore(): number {
    if (this.hasMetricChecks()) {
      const metricChecksArray = Object.values(this.metricChecks);
      const count = metricChecksArray.length;

      const successChecksCount = metricChecksArray.filter(({ check }) => check)
        .length;

      return successChecksCount / count;
    }
    return 0;
  }

  getRawScore(): number {
    const rawChecksArray = _.flatten(Object.values(this.rawChecks));
    const count = rawChecksArray.length;
    const successChecksCount = rawChecksArray.filter(({ check }) => check)
      .length;

    return successChecksCount / count;
  }
}

import { Check, MetricCheck } from './Check';
import { MetricCheckAggregation } from './MetricCheckAggregation';

export interface RequestsSummaryInfo {
  count: number;
  failed: number;
  success: number;
}

export class CheckCollection {
  private readonly checks: Check[];
  constructor(checks: Check[]) {
    this.checks = checks || [];
  }

  getChecks(): Check[] {
    return this.checks;
  }

  getLatency(): number[] {
    const getLatencyField = (check: Check) => check.latency;
    return this.checks.map(getLatencyField);
  }

  getErrorChecks(): Array<string | []> {
    const getErrorField = (check: Check) => check.error;
    return this.checks.map(getErrorField) || [];
  }

  getSummaryInformation(): RequestsSummaryInfo {
    const checks = this.checks;
    const count = checks.length;
    const success = checks.reduce((acc, check) => {
      if (check.overallScore === 1) {
        acc = acc + 1;
      }
      return acc;
    }, 0);
    return {
      count,
      success,
      failed: count - success,
    };
  }

  getTimestampRange(): { from: number; to: number } {
    if (this.isEmpty()) {
      return undefined;
    }

    return {
      from: this.getFirstElement().timestamp,
      to: this.getLastElement().timestamp,
    };
  }

  getFirstElement(): Check {
    return this.checks[0];
  }

  getLastElement(): Check {
    return this.checks[this.checks.length - 1];
  }

  isEmpty(): boolean {
    return this.checks.length === 0;
  }

  getMetricsChecks(): Map<string, MetricCheckAggregation> {
    const metricChecks = new Map<string, MetricCheckAggregation>();

    if (this.isEmpty()) return metricChecks;

    const fElem = this.getFirstElement();

    function create(
      name: string,
      metricCheck: MetricCheck
    ): MetricCheckAggregation {
      return {
        metricName: name,
        values: [metricCheck.value],
        threshold: metricCheck.threshold,
        checks: [metricCheck.check],
        modelVer: fElem.modelVersion,
        modelName: fElem.modelName,
        modelVerId: fElem.modelVersionId,
      };
    }

    function update(
      current: MetricCheckAggregation,
      add: MetricCheck
    ): MetricCheckAggregation {
      return {
        ...current,
        values: [...current.values, add.value],
        threshold: add.threshold,
        checks: [...current.checks, add.check],
      };
    }

    return this.getChecks().reduce((acc, check) => {
      const metrics = Object.entries(check.metricChecks);

      metrics.forEach(([metricName, metricCheck]) => {
        if (metricChecks.has(metricName)) {
          const currentFoo = metricChecks.get(metricName);

          metricChecks.set(metricName, update(currentFoo, metricCheck));
        } else {
          metricChecks.set(metricName, create(metricName, metricCheck));
        }
      });

      return metricChecks;
    }, metricChecks);
  }
}

import { Injectable } from '@angular/core';
import { Metric } from '@app/modules/visualization/models';
