import { Directive, ElementRef, Input, OnInit } from '@angular/core';
import { ColorPaletteService } from '@app/core/color-palette.service';

@Directive({
  selector: '[hsColorByDrift]',
})
export class ColorByDriftDirective implements OnInit {
  @Input() drift: number;

  constructor(
    private readonly el: ElementRef,
    private readonly colorPalette: ColorPaletteService
  ) {}

  ngOnInit(): void {
    if (this.drift === 0 || this.drift <= 0.35) {
      this.el.nativeElement.style.color = this.colorPalette.successColor();
    } else if (this.drift > 0.35 && this.drift <= 0.76) {
      this.el.nativeElement.style.color = this.colorPalette.alertColor();
    } else {
      this.el.nativeElement.style.color = this.colorPalette.warningColor();
    }
  }
}

import { Directive, ElementRef, Input, OnDestroy } from '@angular/core';
import { fromEvent, Subscription, BehaviorSubject } from 'rxjs';
import { tap, filter, delay } from 'rxjs/operators';

@Directive({
  selector: '[hsCopyToBuffer]',
})
export class CopyToBufferDirective implements OnDestroy {
  @Input() hsCopyToBuffer: string;
  private clickSubscriprtion$: Subscription;
  private toogleDelay = 3000;
  private copy$ = new BehaviorSubject<boolean>(false);

  constructor(public el: ElementRef) {
    this.copy$.subscribe(copy => this.setHostElementText(copy));
    this.clickSubscriprtion$ = this.createClickSubscription();
  }

  ngOnDestroy() {
    this.clickSubscriprtion$.unsubscribe();
    this.copy$.complete();
  }

  private createClickSubscription(): Subscription {
    return fromEvent(this.el.nativeElement, 'click')
      .pipe(
        filter(_ => this.copy$.getValue() === false),
        tap(_ => {
          this.copy$.next(true);
        }),
        delay(this.toogleDelay),
        tap(_ => {
          this.copy$.next(false);
        })
      )
      .subscribe();
  }

  private copyToClipboard(text: string): void {
    const el = document.createElement('textarea');
    el.value = text;
    el.setAttribute('readonly', '');
    el.style.position = 'absolute';
    el.style.left = '-9999px';
    document.body.appendChild(el);
    el.select();
    document.execCommand('copy');
    document.body.removeChild(el);
  }

  private setHostElementText(copy: boolean): void {
    if (copy) {
      this.copyToClipboard(this.hsCopyToBuffer);
      this.el.nativeElement.innerText = 'copied';
    } else {
      this.el.nativeElement.innerText = 'copy';
    }
  }
}

import { Directive, Input, ElementRef } from '@angular/core';
import * as d3 from 'd3';
import { ScaleLinear, format } from 'd3';

type AxisPosition = 'top' | 'left' | 'bottom' | 'right';

@Directive({
  selector: '[hsD3Axis]',
})
export class D3AxisDirective {
  @Input() position: AxisPosition = 'bottom';

  @Input() ticks: number = 3;
  @Input()
  set scale(scale: ScaleLinear<number, number>) {
    if (!scale) {
      return;
    }
    let axis;

    switch (this.position) {
      case 'left':
        axis = d3.axisLeft(scale).ticks(this.ticks);
        break;
      default:
        axis = d3.axisBottom(scale).ticks(this.ticks);
    }
    d3.select(this.el.nativeElement).call(axis);
  }

  @Input()
  set transform(transform: string) {
    if (transform) {
      this.el.nativeElement.setAttribute('transform', transform);
    }
  }

  constructor(public el: ElementRef) {
    this.el.nativeElement.setAttribute('color', '#486581');
  }
}

