import { Directive, ElementRef, Renderer2, Input } from '@angular/core';

@Directive({
  selector: '[hsPixelToCanvas]',
})
export class PixelToCanvasDirective {
  @Input() width: number;
  @Input() height: number;
  @Input()
  set pixels(pixels) {
    this.renderer.setAttribute(this.el.nativeElement, 'width', `${this.width}`);
    this.renderer.setAttribute(
      this.el.nativeElement,
      'height',
      `${this.height}`
    );
    if (pixels) {
      try {
        const clampedArray = new Uint8ClampedArray(pixels);
        const imgData = new ImageData(clampedArray, this.width, this.height);
        this.context.putImageData(imgData, 0, 0);
      } catch (e) {
        console.error(e);
      }
    }
  }
  private context: CanvasRenderingContext2D;

  constructor(private el: ElementRef, private renderer: Renderer2) {
    this.context = el.nativeElement.getContext('2d');
  }
}

import { Directive, ElementRef, Input, OnInit } from '@angular/core';

@Directive({
  selector: '[hsScaleImage]',
})
export class ScaleImageDirective implements OnInit {
  @Input() width;
  @Input() height;

  private minWidth: number = 100;
  private minHeight: number = 100;

  constructor(private el: ElementRef) {}

  ngOnInit(): void {
    try {
      this.isValidInputs();
      if (this.imageMustBeScaled()) {
        this.scaleImage();
      }
    } catch (error) {
      console.error(error);
      return;
    }
  }

  private isValidInputs() {
    if (!this.width || !this.height) {
      throw new Error('Height and width must be exist');
    }
  }

  private imageMustBeScaled(): boolean {
    return this.height < this.minHeight || this.width < this.minWidth;
  }

  private scaleImage(): void {
    let scale = 1;

    if (this.width === this.height || this.width < this.minWidth) {
      scale = this.minWidth / this.width;
    } else {
      scale = this.minHeight / this.height;
    }

    const transformStr = `transform: scale(${scale}); transform-origin: 0 0`;
    (this.el.nativeElement as HTMLElement).setAttribute('style', transformStr);
  }
}

