import {
  Component,
  Input,
  ViewChild,
  ElementRef,
  AfterViewInit,
} from '@angular/core';
import * as d3 from 'd3';

@Component({
  selector: 'hs-d3area',
  template: `<svg:path #path></svg:path> `,
})
export class D3AreaComponent implements AfterViewInit {
  @ViewChild('path', { read: ElementRef, static: true })
  path: ElementRef;

  @Input() 'hs-d3area';
  @Input() xScale;
  @Input() yScale;
  @Input() y0 = 0;
  @Input() set data(d: Array<[number, number]>) {
    d3.select(this.path.nativeElement)
      .data([d])
      .transition()
      .duration(500)
      .ease(d3.easeLinear)
      .attr('d', this.area);
  }
  @Input() stroke;

  private area;
  ngAfterViewInit(): void {
    this.area = d3
      .area()
      .x((d: any) => {
        const x = this.xScale(d[0]);
        console.dir({
          d0: d[0],
          x,
        });
        return this.xScale(d[0]);
      })
      .y1((d: any) => {
        console.dir({
          d1: d[1],
          y: this.yScale(d[1]),
        });
        return this.yScale(d[1]);
      })
      .y0(this.yScale(this.y0));
  }
}

import {
  ChangeDetectionStrategy,
  Component,
  ElementRef,
  Input,
  OnChanges,
  ViewChild,
} from '@angular/core';
import { easeLinear, line, select, curveMonotoneX } from 'd3';

@Component({
  selector: 'hs-d3line',
  template: `<svg:path #path></svg:path> `,
  changeDetection: ChangeDetectionStrategy.OnPush,
})
export class D3LineComponent implements OnChanges {
  @ViewChild('path', { read: ElementRef, static: true })
  path: ElementRef;
  @Input() 'hs-d3line';
  @Input() xScale;
  @Input() yScale;
  @Input() data: number[];

  ngOnChanges(changes) {
    const xScale = changes.xScale.currentValue;
    const yScale = changes.yScale.currentValue;
    const data = changes.data
      ? changes.data.currentValue.map((v, i) => [i + 1, v])
      : this.data.map((v, i) => [i + 1, v]);

    const valueline = line()
      .x(d => xScale(d[0]))
      .y(d => yScale(d[1]))
      .curve(curveMonotoneX);

    select(this.path.nativeElement)
      .data([data])
      .transition()
      .duration(500)
      .ease(easeLinear)
      .attr('d', valueline)
      .attr('stroke-width', '1px')
      .attr('fill', 'none');
  }
}

import { Component, ChangeDetectionStrategy, Input } from '@angular/core';

@Component({
  selector: 'hs-d3-plot-band',
  template: `<svg:rect
    [attr.x]="x"
    y="0"
    [attr.width]="width"
    [attr.height]="height"
  ></svg:rect>`,
  changeDetection: ChangeDetectionStrategy.OnPush,
})
export class D3PlotBandComponent {
  @Input() 'hs-d3-plot-band': { from: number; to: number };
  @Input() height;
  @Input()
  set xScale(scale) {
    if (this['hs-d3-plot-band']) {
      const { to, from } = this['hs-d3-plot-band'];
      const y = scale(to);
      this.x = scale(from);
      this.width = y - this.x;
    }
  }

  x: number = 0;
  width: number = 0;
}

import {
  ChangeDetectionStrategy,
  Component,
  Input,
  OnChanges,
  SimpleChanges,
} from '@angular/core';

@Component({
  selector: 'hs-d3threshold',
  template: `<svg:line
    x1="0"
    [attr.x2]="x2"
    [attr.y1]="y1"
    [attr.y2]="y2"
    stroke="#E12D39"
    stroke-dasharray="10px"
  ></svg:line> `,
  changeDetection: ChangeDetectionStrategy.OnPush,
})
export class D3ThresholdComponent implements OnChanges {
  @Input() yScale;
  @Input() 'hs-d3threshold';
  @Input() width: number;

  y1: number = 0;
  y2: number = 0;
  x2: number = 0;

  ngOnChanges(changes: SimpleChanges): void {
    const threshold = changes['hs-d3threshold']
      ? changes['hs-d3threshold']
      : this['hs-d3threshold'];
    const yScale = changes.yScale ? changes.yScale.currentValue : this.yScale;
    const width = changes.width ? changes.width.currentValue : this.width;

    if (threshold !== undefined && yScale) {
      const y = yScale(threshold) || 0;
      this.y1 = y;
      this.y2 = y;
      this.x2 = width;
    }
  }
}

import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { DeploymentConfigsFacade } from '@app/core/facades/deployment-configs.facade';
import { PreserveFormService } from './preserve-form.service';

@Component({
  selector: 'hs-dc-form',
  templateUrl: './dc-form.component.html',
  styleUrls: ['./dc-form.component.scss'],
})
export class DcFormComponent implements OnInit {
  form: string;
  formIsValid: boolean;
  warning: string = '';

  constructor(
    private readonly facade: DeploymentConfigsFacade,
    private router: Router,
    private formPreserver: PreserveFormService
  ) {}

  ngOnInit(): void {
    this.form = this.formPreserver.retrieveForm()
      ? this.formPreserver.retrieveForm()
      : this.formPreserver.defaultForm();
    this.onChange(this.form);
  }

  onChange(e: string) {
    try {
      this.formPreserver.validateForm(this.form);
      this.formIsValid = true;
      this.formPreserver.saveForm(this.form);
      this.warning = '';
    } catch (err) {
      this.formIsValid = false;
      this.warning = err;
    }
  }

  onSave() {
    let value = this.formPreserver.parseDC(this.form);
    this.facade.add(value);
    this.formPreserver.clearForm();
    this.router.navigate([`deployment_configs/${value.name}`]);
  }

  resetForm() {
    this.form = this.formPreserver.defaultForm();
    this.formPreserver.clearForm();
    this.formIsValid = false;
  }
}

