  private readonly formsChangeDebounceMs: number = 300;

  sliderOptions: Options = {
    floor: 0,
    ceil: 100,
    step: 1,
    showTicks: true,
    animate: false,
  };

  constructor(private readonly fb: FormBuilder) {
    this.form = this.fb.group({
      filterBy: this.fb.control(ChecksHealthFilterOptions.all),
