        byMetric: this.fb.control(true),
        byRaw: this.fb.control(true),
        metricScoreRange: this.fb.control([0, 100]),
        rawScoreRange: this.fb.control([0, 100]),
      }),
    });
  }

  ngOnInit() {
    this.form.valueChanges
      .pipe(debounceTime(this.formsChangeDebounceMs))
